import React from "react";

const LongStripIcon = (props) => {
  return (
    <svg
      width="30"
      height="1"
      viewBox="0 0 30 1"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      {...props}
    >
      <rect width="30" height="1" fill="white" />
    </svg>
  );
};

export default LongStripIcon;
